Ninguém fala que EM UM OU UNS desses ônibus fretados pelo partido, foram encontrados muito dinheiro com alguém ligado ao partido, ou seja CRIME ELEITORAL... foram feitos nas seguintes regiões : 272 operações no Nordeste (49,5% do total);
59 no Norte (10,7%);
48 no Sudeste (8,74%), e
48 no Sul (8,74%).     E não só no nordeste.....   JORNALISMO VERGONHOSO
